import React, { Component } from 'react'
import Navbar from 'react-bootstrap/Navbar';
import Container from "react-bootstrap/Container";
import './Nav_top.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import logo from '../../nav-logo.png';
import {Link} from 'react-scroll'
import styled from "styled-components";

const NavUnlisted = styled.ul`
  text-decoration: none;
`;


export default class Nav_Top extends Component {
    render() {
        return (
            <Navbar bg="light" variant="light" sticky="top">
                <Container>
                    <Navbar.Brand href="#home"><img
                        src={logo}
                        width="325"
                        height="60"
                        className="d-inline-block align-top"
                        alt="React Bootstrap logo"
                    /></Navbar.Brand>
                    <ul className="me-auto" >
                        <li><Link activeClass="active" to="home" spy={true} smooth={true} style={linkStyle}>Home</Link></li>
                        <li><Link  to="AboutUS" spy={true} smooth={true}>AboutUS</Link></li>
                        <li><Link  to="Header" spy={true} smooth={true}>Header</Link></li>
                        <li><Link  to="News" spy={true} smooth={true}>News</Link></li>
                        <li><Link  to="Members" spy={true} smooth={true}>TeamMembers</Link></li>
                        <li><Link  to="Events" spy={true} smooth={true}> Events</Link></li>
                    </ul>
                </Container>
            </Navbar>
        )
    }
}
